      projectItems = this.props.projects.map(project  => {
          // console.log(project);
          return <ProjectItem key={project.title} project={project}/>
        });
    }
    console.log(this.props);
    return (
      <div className="Projects">
        {projectItems}
      </div>
    );
  }
}

export default Projects;
